                            <span 
                              id="imgCaptureErrMsg"
                              style={{color:"red"}}>
                            </span>
                          </table>
                          <table>
                            <tr>
                              <td 
                                className={classes.cell14} 
                                style={{textAlign:"right"}}>
                                <label 
                                  htmlFor="idCapture" 
                                  style={labelstyle}>
                                  ID Capture Setting:
                                </label>
                              </td>
                              <td 
                                className={classes.cell15} 
                                style={{textAlign: "right"}}>
                                <label 
                                  style={labelstyle} 
                                  style={{paddingBottom: "0", color: "#3cB650"}}>
                                  No
                                </label>
                                  <br/>
                                <label 
                                  style={labelstyle} 
                                  style={{paddingBottom:"0", color: "#3cB650"}}>
                                  Yes
                                </label>
                                <br/>
                              </td>
                              <td 
                                className={classes.cell16} 
                                style={{textAlign:"center"}}>
                                <div>
                                  <label 
                                    id="labelr" 
                                    className={classes.RadioButton}>
                                    <input type="radio" 
                                      name="idCapture" 
                                      id="idCaptureNo"
                                      value="false"
                                      onChange={this.handleidCapture}  
                                       />
                                    <span 
                                      className={classes.checkmark}>
                                    </span>
                                  </label>
                                    <label 
                                      id="labelr" 
                                      className={classes.RadioButton}>
                                    <input 
                                      type="radio" 
                                      name="idCapture" 
                                      id="idCaptureYes" 
                                      value="true"
                                      onChange={this.handleidCapture}
                                      />                                  
                                    <span 
                                      className={classes.checkmark}>  
                                    </span>
                                  </label>
                                </div>
                              </td>
                            </tr>
                            <span 
                              id="idCaptureErrMsg"
                              style={{color:"red"}}>
                          </span>
                          </table>
                          <table>
                          <tr>
                            <td 
                              id={classes.cell1}  
                              style={{textAlign:"right"}}>
                              <label 
                                htmlFor="frameInterval" 
                                style={labelstyle}>
                                Frame Interval:
                              </label>
                            </td>
                            <td 
                              className={classes.cell2} 
                              style={{textAlign:"left", width:"30%"}}>
                              <input 
                                style={textbxstyle} 
                                type="text" 
                                id="frameinterval"
                                value={this.state.configuration.frameInterval}
                                onChange={this.handleframeiChange} 
                                name="frameinterval"
                                onBlur={this.frameintervalVal}                                
                                />
                              <br/>
                              <span 
                                id="frameintervalErrMsg"
                                style={{color:"red"}}>
                              </span>
                            </td>
                          </tr>
                          <tr>
                            <td 
                              className={classes.cell1} 
                              style={{textAlign:"right"}}>
                              <label 
                                htmlFor="anomalyDuration" 
                                style={labelstyle}>
                                Anomaly Duration:
                              </label>
                            </td>
                            <td 
                              className={classes.cell2} 
                              style={{textAlign:"left"}}>
                              <input 
                                style={textbxstyle} 
                                type="text" 
                                id="anomalyduration"
                                onChange={this.handleanomdChange}
                                value={this.state.configuration.anomalyDuration}  
                                name="anomalyduration"
                                onBlur={this.anomalydurationVal}
                                />
                              <br/>
                              <span 
                                id="anomalydurationErrMsg"
                                style={{color:"red"}}>
                              </span>
                            </td>
                          </tr>
                          <tr>
                            <td 
                              className={classes.cell1} 
                              style={{textAlign:"right"}}>
                              <label 
                                htmlFor="smoothingFrame" 
                                style={labelstyle}>
                                Smoothing Frame:
                              </label>
                            </td>
                            <td 
                              className={classes.cell2} 
                              style={{textAlign:"left"}}>
                              <input 
                                style={textbxstyle} 
                                type="text" 
                                id="smoothingframe"
                                value={this.state.configuration.smoothingFrame} 
                                onChange={this.handlesmoothfChange}
                                name="smoothingframe"
                                onBlur={this.smoothingframeVal}
                                />
                              <br/>
                              <span 
                                id="smoothingframeErrMsg"
                                style={{color:"red"}}>
                              </span>
                            </td>
                          </tr>
                          </table>
                        </div>
                      </Accordion3>
                        <div className={classes.flexChild}>
                          <table>
                            <tr>
                              <td 
                                className={classes.cell7} 
                                style={{textAlign:"right", paddingRight: "2%", paddingTop:"2%"}}>
                                <input
                                  onClick={this.stateUpdate}
                                  type="submit" value="Submit" 
                                  style={buttonstyle}/>
                              </td>
                            </tr>
                          </table>
                        </div>
            </fieldset>
          </form>
        </main>
      </div>
    );
  }
}

export default withRouter(EditOrgForm);
